  true,\n\t\"url\": null,\n\t\"notes\": \"The CARPE Information Management Tool (CARPE
  IMT), available in both French and English, organizes information and reports from
  its partners for the 12 CARPE/CBFP landscapes and for macro-zones within each landscape
  (protected areas, community zones, and extractive resource zones). Landscape-level
  documents and reports to include Land Use Planning Documents (Strategy Documents
  and Management Plans), summaries of the overall status of the Land Use Planning
  Process, and other reports categorized as either Ecological, Socio-economic, Stakeholder
  Participation, or Implementation Activities information are available in this tool.
  It was developed and is managed today by the University of Maryland.\",\n\t\"license_title\":
